name = "git"

[params.short]
flag = [ "p" ]
path = [ "C" ]
keyvalue = [
    [   "c",
        "advice.pushUpdateRejected",
        "advice.pushNonFFCurrent",
        "core.editor",
    ],
]

[params.long]
flag = [
    "version",
    "help",
    "html-path",
    "man-path",
    "info-path",
    "paginate",
    "no-pager",
    "no-replace-object",
    "bare",
    "literal-pathspecs",
    "glob-pathspecs",
    "noglob-pathspecs",
    "icase-pathspecs",
    "no-optional-locks",
]
path = [
    "git-dir",
    "work-tree",
    "namespace",
    "super-prefix",
]
path_optional = [
    "exec-path",
]
file = [
    [ "test", ".txt", ".md" ],
]

