    flag = [ "v", "n", "f", "i", "p", "e", "u", "N", ]

    [commands.params.long]
    flag = [
        "verbose",
        "dry-run",
        "force",
        "interactive",
        "patch",
        "edit",
        "all",
        "no-all",
        "ignore-removal",
        "no-ignore-removal",
        "update",
        "intent-to-add",
        "refresh",
        "ignore-errors",
        "ignore-missing",
        "renormalize",
    ]

